<style>
     #fixed-bg {
    /* background: #033 */
    /* transform: rotateY(180deg) */
    z-index: -1;
    /* background-color: #737; */
    background-color: #006c62;
  }
  #fixed-bg div {
    background: linear-gradient(transparent, #000c);
    
    /* background: linear-gradient(300deg, #054 60%, #222 60%, #2222 60.3%, #2221 60.5%, transparent 60%) */
  }
  #fixed-bg img {
    /* -o-object-position: 20% 0%; */
    /* object-position: calc(50% - 30vw) 50%; */
    -webkit-transition: 0.1s;
    transition: 0.1s;
    /* transform: translateX(-25%); */
    filter: opacity(1) saturate(1) grayscale(0);
    animation: zoom-bg 5s ease-in-out forwards;
  }
  #fixed-bg #svg-parent{
    background: transparent;
    animation: moving-circle 30s infinite;
  }
  svg{
    animation: spin-forever 3s linear infinite;
    /* animation: moving-circle 20s ease-in-out ; */
  }
  @media (max-width: 640px) {
    #fixed-bg img {
        object-position: calc(50% - 30vw) 50%;
    }
  }
  @keyframes zoom-bg {
    0%{
      transform: scale(1.4)
    }
    100%{
      transform: scale(1)
    }
  }
  @keyframes moving-circle {
    0%{
      transform: translate(-100%, -100%);
      opacity: 0.7;
    }
    95%{
      transform: scale(3) translate(25%, 20%);
      opacity: 0.3;
    }
    100%{
      transform: scale(3.5) translate(25%, 20%);
      opacity: 0;
    }
  }
  @keyframes spin-forever {
    0%{
      transform: rotate(180deg);
    }
    100%{
      transform: rotate(360deg);

    }
  }
</style>
